export default function getTotalCount(filteredSearch, data, ret=['device', 'user', 'did']) {
  return {
    'display': Math.ceil(filteredSearch['device']['results'].length/ 100),
    "user": Math.ceil(filteredSearch['user']['results'].length/ 100),
    "did": Math.ceil(filteredSearch['did']['results'].length/ 100)
  }
}
